import React from 'react';

import SportSeeLogo from '../../assets/icons/sportsee_logo.svg';
import { Link } from 'react-router-dom';
import { useContext } from 'react';
import ContextProvider from '../../utils/context/context';

import './Header.css';

const Header = () => {
	const userId = useContext(ContextProvider);
	console.log('Header : ', userId);
	return (
		<header className="header">
			<div className="header__logo">
				<Link to="/">
					<img src={SportSeeLogo} alt="SportSee Logo" />
				</Link>
			</div>
			<nav>
				<ul className="header__nav">
					<Link to={`/user/${userId.id}`} className="active">
						Accueil
					</Link>
					<Link to={`/user/${userId.id}/profil`}>Profil</Link>
					<Link to={`/user/${userId.id}/settings`}>Settings</Link>
					<Link to={`/user/${userId.id}/community`}>Communaut√©</Link>
				</ul>
			</nav>
		</header>
	);
};

export default Header;
